import React from 'react';

function Location() {
  return (
    <div style={{
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      height: "100vh",
    }}>
      <h1>
        GeeksforGeeks is a Computer Science portal for geeks.
      </h1>
    </div>
  );
}

export default Location;
